import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import styled from "styled-components";

function Login() {
  return (
    <Container>
      <Content>
        <BoxLoginImput>
          <Link to="/Empresa">About</Link>
        </BoxLoginImput>
        <BoxLoginArt>
          <img src="./src/img/art.svg" />
        </BoxLoginArt>
      </Content>
    </Container>
  );
}
const Container = styled.div`
  display: flex;
  height: 100%;
  background: #ededed;
  width: 100%;
  align-items: center;
  justify-content: center;
  position: fixed;
`;
const Content = styled.div`
  display: flex;
  height: 400px;
  background: #fff;
  width: 600px;
  border-radius: 10px;
  box-shadow: 0px 0px 5px #cfcfcf;
`;
const BoxLoginImput = styled.div`
  display: flex;
  height: 100%;
  flex: 1;
  border-radius: 10px 0px 0px 10px;
  background: #fff;
`;
const BoxLoginArt = styled.div`
  display: flex;
  height: 100%;
  flex: 1.3;
  border-radius: 0px 10px 10px 0px;
  background: black;
`;
export default Login;
